CREATE DEFINER = 'griva'@'' PROCEDURE `usp_DeleteTable`(IN Table_ VARCHAR(255), IN Conditions_ VARCHAR(2000), IN idUsuario_ INTEGER(11), IN idTransaccion_ INTEGER(11), IN sDetalle_ VARCHAR(4096))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
DECLARE LastId INT(11);

SET AUTOCOMMIT=0;
START TRANSACTION;

SET @SQL_ = CONCAT("DELETE FROM ",Table_);

IF(Conditions_ <> "")THEN
    SET @SQL_ = CONCAT(@SQL_ , " WHERE " ,Conditions_);
END IF;
      
PREPARE stmt FROM @SQL_;
EXECUTE stmt;
DEALLOCATE PREPARE stmt; 

SET LastId = LAST_INSERT_ID();

CALL usp_InsertAuditoria(idUsuario_,idTransaccion_,sDetalle_);

SELECT LastId;

COMMIT;
END;

CREATE DEFINER = 'griva'@'' PROCEDURE `usp_getAllPermitsUser`(IN idUser_ INTEGER(11))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN

SELECT
    permisosobjetos.idObjeto as 'idObjeto',
    group_concat(permisosobjetos.idTipoPermiso)  as 'sPermisos'
    ##objetos.sNombre as 'sObjeto'
FROM
    permisosobjetos
    LEFT JOIN objetos ON permisosobjetos.idObjeto = objetos.id
    LEFT JOIN permisosobjetosusuarios ON permisosobjetos.id = permisosobjetosusuarios.idPermisoObjeto
WHERE
    permisosobjetosusuarios.idUsuario = idUser_ 
group by permisosobjetos.idObjeto
ORDER BY permisosobjetos.idObjeto ASC;
        
END;

CREATE DEFINER = 'griva'@'' PROCEDURE `usp_getCampanias`(IN CONDITIONS_ VARCHAR(255), IN ORDER_ TEXT, IN OFFSET_ VARCHAR(8), IN NUM_ VARCHAR(8))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN

SET @SQL_ = "
		SELECT 
        campanias.id as 'id',
        campanias.idEstadoTrabajo as 'idEstadoTrabajo',
        campanias.sRemitente as 'sRemitente',
        campanias.sTitulo as 'sTitulo',
        campanias.sMensaje as 'sMensaje',
        campanias.sObservacion as 'sObservacion',
        DATE_FORMAT(campanias.dFechaEnvio, '%d/%m/%Y %h:%i:%s') as 'dFechaEnvio',
        DATE_FORMAT(campanias.dFechaRegistro, '%d/%m/%Y %h:%i:%s') as 'dFechaRegistro'
        FROM
        	campanias
		";

IF(CONDITIONS_ != "")THEN
	SET @Conditions_ = CONCAT(" WHERE " , CONDITIONS_ );
	SET @SQL_ = CONCAT(@SQL_, " ", @Conditions_);
END IF;

IF(ORDER_ != "")THEN
	SET @Order_ = CONCAT(" ORDER BY " , ORDER_, " DESC" );
	SET @SQL_ = CONCAT(@SQL_, " ",@Order_);
END IF;


IF(OFFSET_ != "" AND NUM_ != "")THEN
	SET @Limit_ = CONCAT("LIMIT " , OFFSET_ , "," , NUM_);
	SET @SQL_ = CONCAT(@SQL_, " ",@Limit_);
END IF;

PREPARE stmt FROM @SQL_;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
END;

CREATE DEFINER = 'griva'@'' PROCEDURE `usp_getCampanias1`(IN CONDITIONS_ VARCHAR(255), IN ORDER_ TEXT, IN OFFSET_ VARCHAR(8), IN NUM_ VARCHAR(8))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN

SET @SQL_ = "
		SELECT 
        campanias.id as 'id',
        campanias.idEstadoTrabajo as 'idEstadoTrabajo',
        campanias.sRemitente as 'sRemitente',
        campanias.sTitulo as 'sTitulo',
        campanias.sMensaje as 'sMensaje',
        campanias.sObservacion as 'sObservacion',
